import Link from 'next/link';

const Header = () => (
	<div>
		<Link href="/"><a>Home</a></Link>
		<Link href="/list"><a>Question list</a></Link>
		<Link href="/new"><a>Add new</a></Link>
	</div>
);

export default Header;
